	spanOptions := &structs.BinSpanOptions{
		LogSpan: logSpan,
	}
	binOptionArgs := &BinOptionArgs{
		argOption: "span",
		binOptions: &structs.BinCmdOptions{
			BinSpanOptions: spanOptions,
		},
	}
	return binOptionArgs, nil
